A few days ago we finished the first YogaSlackers’ Ireland Cycling Adventure. We were guided by Rachel and Iszy of @rachelsirishadventures through some of the most beautiful locations we have ever seen: ocean, mountains, rivers, open skies and (mostly) dry and cool days. The tour was truly spectacular. 

However, the most impressive part of the tour was the participants. Each and every single person that came to this event brought so much energy, love, enthusiasm, and pure life! 

We will have years of footage to go through. And we are SO happy about it. Because every audio recording, every video, every picture is filled with a little bit of their amazingness. 

Thank you for joining us in this adventure. 
Thank you for sharing your amazing talents with us. 
Thank you for being you. 

