During an #AcroYogaJam in Tokyo we started playing with this transition. Mainly because we were searching for easier ways to enter this pose when the flyer is taller than the base (which is definitely not our case!) 

Somehow, this materialized and we love it! It is a testament to our continued practice. We still remember when entering this pose from the ground was super challenging. Both base and flyer need to keep a really strong core, leg extension and engagement. And we used to struggle with a lot of that. 

Through practice, repetition and applying the YogaSlackers Principles of Acrobatics, this pose is now very simple to perform and new flows are easy to create. 

We will be sharing our practice and teaching method during our next teacher training. Come practice, learn and refine with us. 

